import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import reportWebVitals from "./reportWebVitals";
import App from "./App";
import { Provider } from "react-redux";
import { createStore, applyMiddleware } from "redux";
import thunk from "redux-thunk";
import todosReducer from "../src/reducer/lists";

// use applyMiddleware to add the thunk middleware to the store
const store = createStore(todosReducer, applyMiddleware(thunk));


  store.subscribe(() => {
    if (store.getState().action.indexOf('todos') !== -1) {
        console.log('subscribed for messanger actions', store.getState());
    }
});

console.log('----------------Action with both subscriber-------------');
store.dispatch({ type: 'ADD_PERSON_SUCCESS' });

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}>

    </Provider>
  </React.StrictMode>,
  document.getElementById("root")
);

